import React, {Dispatch} from "react";
import Logo from '../assets/images/top_logo.png';
import BaseButtons from "./commons/baseButtos";

interface Props {
    type?: string;
    setType : React.SetStateAction<Dispatch<string>>
}
export default function Header({type, setType} : Props) {
    return (
        <div>
            <img src={Logo} alt={'Logo'} />
            <div>
                <BaseButtons  text={'마이체크업'} className='bg-black'/>
                <BaseButtons  text={'벨류맵'} className={''}/>
            </div>
        </div>
    )
}
